package datastructure.primitive;

public class Ex01PrimitiveDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int digit = 24;
		float point = 8;
		float point2 = 8.2f;
		char letter = 'A';
		System.out.println("Giá trị của digit: " + digit);
		System.out.println("Giá trị của point: " + point);
		System.out.println("Giá trị của point2: " + point2);
		System.out.println("Giá trị của letter: " + letter);
	}

}
